  return(
    <>
<Router>
                    <h1>Movies App!</h1>
                    <p>Search Entertainment</p>

                <Switch>
                  <Route path="/" exact component={MoviesResults}></Route>
                  <Route path="/movieDetails" exact component={MoviesDetails}></Route>
                  <Route component={NoMatch} />
                </Switch>

        </Router>
    </>
  );
}
export default App;
